import{_ as a,c as e,o as i,a1 as l}from"./chunks/framework.BwTyoF0R.js";const m=JSON.parse('{"title":"简历分析","description":"","frontmatter":{},"headers":[],"relativePath":"模拟面试-wiki/01-课程内容/02-张扬/01-简历分析.md","filePath":"模拟面试-wiki/01-课程内容/02-张扬/01-简历分析.md"}'),t={name:"模拟面试-wiki/01-课程内容/02-张扬/01-简历分析.md"},r=l('<h1 id="简历分析" tabindex="-1">简历分析 <a class="header-anchor" href="#简历分析" aria-label="Permalink to &quot;简历分析&quot;">​</a></h1><h2 id="专业技能" tabindex="-1">专业技能 <a class="header-anchor" href="#专业技能" aria-label="Permalink to &quot;专业技能&quot;">​</a></h2><p>毕业 6 年，要写出更多的技术优势</p><ul><li>TS 是否熟悉？</li><li>Vue3 是否熟悉？</li><li>Vue 原理了解哪些？写出几个技术名词</li><li>webpack vite babel 是否熟悉</li><li>性能优化是否熟悉？</li><li>react 是否了解一些？</li></ul><h2 id="工作经历" tabindex="-1">工作经历 <a class="header-anchor" href="#工作经历" aria-label="Permalink to &quot;工作经历&quot;">​</a></h2><p>近期的工作经历，可以写出角色和职责。 期望能看到更多开发之外的事情，例如沟通需求、技术方案设计、参与测试、项目管理等 —— 工作 6 年，希望能有项目带头人的潜力</p><h2 id="项目经历-最后两个项目举例" tabindex="-1">项目经历 （最后两个项目举例） <a class="header-anchor" href="#项目经历-最后两个项目举例" aria-label="Permalink to &quot;项目经历 （最后两个项目举例）&quot;">​</a></h2><ul><li>补充项目介绍，介绍这个项目的一些复杂功能（例如IM、弹幕、直播），来体现自己的技术优势</li><li>主要工作写的太简单了。工作要体现自己的技术优势，否则就是无用信息 <ul><li>例如“数据库设计”，要写出有多少个表、多少个关系</li><li>例如“前端样式编写”，无用信息，体现不出技术优势</li><li>例如“直播插件调试” “腾讯 IM 弹幕调试”，应该写的再详细一些，这是很好的技术优势。否则没做过的人看不懂，可能就直接忽略了</li></ul></li><li>最好不要写“个人项目”，自己取个名字，面试的时候被问道再解释。（你不是应届生，写“个人项目”会让人觉得自己实际工作不够）</li></ul>',8),o=[r];function _(n,c,s,h,d,u){return i(),e("div",null,o)}const f=a(t,[["render",_]]);export{m as __pageData,f as default};
